President Trump flew on a plane with Florida Man Rep. Matt Gaetz, who is now the third Republican member of Congress under self-quarantine for #COVID2019.

@VP Pence won't say if Trump has been tested for infection.

Forget the #TrumpCrash, this is getting REALLY real for him.

@Cernovich Does @NolteNC think we will be able to take such drastic measures in our country as China took in theirs?

Look at Italy, where people are starting to riot over the quarantine restrictions. 

We can’t put our heads in the sand and wait for things to get that bad here.
